import React from 'react'
import { Container } from 'react-bootstrap'

export const TopTematica = ({params}) => {

    console.log(params);

    return (
        <Container style={{backgroundColor:'#red'}}>
            {params.Componentes.map(info => (
                <div>{info.Titulo}</div>
            ))}
        </Container>
    )
}
